import React from 'react';
import './Styles/Pokecard.css';

const Pokecard = ({ title, text, image, link }) => {
    return (
        <div className="custom-card">
            <img src={image} alt="Card" className="custom-card-img" />
            <div className="custom-card-body">
                <h5 className="custom-card-title">{title}</h5>
                <p className="custom-card-text">{text}</p>
                <a href={link} className="custom-card-btn">Go somewhere</a>
            </div>
        </div>
    );
}

export default Pokecard;
